import React, { useState } from "react";
import { AppBar, Typography, ThemeProvider, CssBaseline, createTheme } from "@mui/material";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import ReactGA from "react-ga4";
import Create from "./Create";  
import Room from "./Room";
import "../css/Main.scss";


// Theme configuration
const theme = createTheme({
typography: {
    fontFamily: ["Times New Roman", "Serif"].join(","),
    h3: {
      letterSpacing: "2px",
      color: "#ffffff",
    },
    allVariants: {
      color: "#ffffff", // makes all text white
    },
  },
  palette: {
    primary: {
      main: "#ffffff", // primary color white
    },
    text: {
      primary: "#ffffff",
      secondary: "#ffffff",
    },
    background: {
      default: "#000000", // black background
      paper: "#000000",
    },
  },
});

// Initialize Google Analytics if key exists
const key = process.env.REACT_APP_ANALYTICS_KEY;
if (key) ReactGA.initialize(key);

const Main = () => {
  const [username, setUsername] = useState("");

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />

      {/* AppBar */}
      <AppBar position="static" className="menu">
        <Typography variant="h5" component="div" sx={{ p: 1 }}>
          <a href="/" style={{ textDecoration: "none", color: "inherit" }}>
            Hangmanonline.io
          </a>
        </Typography>
      </AppBar>

      <div className="container">
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<Create setUser={setUsername} user={username} />} />
            <Route path="/:roomID" element={<Room username={username} />} />
          </Routes>
        </BrowserRouter>
      </div>
    </ThemeProvider>
  );
};

export default Main;
